import React, { Fragment } from "react";

import Header from "../components/Header/Header";

function OtherPage(props) {
  return (
    <Fragment>
      <div className="OtherPage">
        <h1>This is an OTHER URL/Path</h1>
      </div>
    </Fragment>
  );
}

export default OtherPage;
